🔥🔥🔥🔥🔥🔥Уважаемые, соседи! 1 мая прошлись по посёлку и увидели, что не все убрали свои участки от сухостоя ( особенно строящиеся и открытые без забора участки). 
🎈Огромная благодарность всем кто прибрал свою территорию.
📌
Информация:
С 5 апреля 2024 года на территории Свердловской области вступил в силу противопожарный режим👨‍🚒🚒🔥☄ 

В период его действия запрещено:
 — Разводить костры или использовать открытый огонь; 
— Готовить пищу на открытом огне или использовать мангалы; 
— Курить и бросать горящие спички в траву; 
— Поджигать сухую траву, включая сельскохозяйственные угодья; 
— Оставлять стеклянные бутылки на полянах, освещенных солнцем; 
 
Что касается владельцев участков, то им настоятельно рекомендовано удалить сухую траву, прибрать территорию и убрать легковоспламеняющиеся предметы, включая дрова. 
 
⚠ О штрафах
— Для граждан в условиях пожароопасного сезона — от 10 до 20 тысяч рублей; 
— За становление виновником пожара — от 40 до 50 тысяч рублей; 
— Для должностных лиц — от 30 до 60 тысяч рублей; 
— Для предпринимателей без юридического лица — от 60 до 80 тысяч рублей; 
— Для юридических лиц — от 400 до 800 тысяч рублей. 

‼️Соседи, давайте вместе соблюдать меры пожарной безопасности, так как от этого зависит безопасность жилья, здоровья и ваша жизнь.!🙏
